import React from 'react';
import CardList from './cardlist';
import SearchField from './SearchField'
import {robots} from './robots';

const App = () => {
  return (
    <div>
      <h1>RoboFriends</h1>
      <SearchField />
      <CardList robots={robots} />
    </div>  
  );
}

export default App;
